    constructor(props) {
        super(props);

        this.state={
            collections:Shop_Data
      }
    }
    render() {
        const {collections} = this.state;
        return (<div className='shop-page' >
            {
                collections.map(({id, ...otherCollectionProps}) =>(
                    <CollectionPreview key={id} {...otherCollecionProps} />
                ))
            }

        </div>);
    }
}

